import React from 'react';
//import imagelist from "../../images/images";

const imagelist = [
    {id: 1, src: './ARTY13190.jpg'},
    {id: 2, src: './ARTY13190.jpg'},
    {id: 3, src: './ARTY22670.jpg'}
]

const artcard = (props) => {

    let ImgName = (props.imagename) + ".jpg"

    return(
        <div className="artCard">
            <img src={ImgName}/>
            <h4>{props.name}</h4>
            <p>{props.description}</p>
            <p>{props.price}</p>
        </div>
    );
}

export default artcard;
